INSERT INTO `stories` (`story_code`, `story_name`, `another_name_story`, `story_description`, `story_author_name`, `story_author_id`, `count_views`, `views_day`, `views_week`, `views_month`, `views_year`, `count_followes`, `count_likes`, `story_status`, `story_avatar`, `story_categories`, `create_at`, `update_at`) VALUES
('07-ghost', '07 Ghost', '07 ghost; 07-Ghost; Sebun Gousuto; Seven Ghost; Siete Fantasmas; 07-Fantasmas', 'Barsburg Empire Akademi Militer selalu dikenal untuk pelatihan elit dengan potensi untuk menjadi prajurit yang luar biasa yang tidak akan membuat malu nama kekaisaran. Para siswa dari program khusus leluasa memanfaatkan kemampuan yang disebut &quot;Zaiphon&quot; untuk melawan ... kemampuan setiap orang berbeda, dan dalam banyak kasus, mencerminkan sifat mereka.', 'Amemiya Yuki', 'user', 568809, 10, 10, 10, 10, 10, 10, 'dang-cap-nhat', 'https://www.komikid.com/uploads/manga/07-ghost/cover/cover_250x350.jpg', '2', '2020-07-21 10:09:36', '2020-07-21 10:09:36'),
('14-sai-no-koi', '14 Sai No Koi', '14 Sai no Koi; 14sai no Koi; Love at Fourteen', 'Sebuah cerita tentang dua orang muda yang luar biasa matang. Mereka berdua cerdas, sangat bersama-sama dan mereka sedang jatuh cinta. Namun, seperti tumbuh karena mereka bertindak, mereka masih hanya 14 dan perasaan mereka satu sama lain ditangkap dengan kelembutan dan kurangnya nostalgia, tapi sangat menggemaskan.', 'Mizutani Fuka', 'user', 253597, 10, 10, 10, 10, 9, 10, 'dang-cap-nhat', 'https://www.komikid.com/uploads/manga/14-sai-no-koi/cover/cover_250x350.jpg', '2', '2020-07-21 10:36:20', '2020-07-21 10:36:20'),
('16-life', '16 Life', 'Sixteen Life; 16 vie', 'Saya adalah perempuan lesu siswa SMA biasa. Pada karaoke saat dia menyanyikan antusias lagu dari artis favoritnya, Takase Kazuki, orang sendiri mengawasinya ... !?', 'Aikawa Saki', 'user', 574148, 11, 11, 11, 11, 10, 10, 'dang-cap-nhat', 'https://www.komikid.com/uploads/manga/16-life/cover/cover_250x350.jpg', '2', '2020-07-21 10:40:16', '2020-07-21 10:40:16'),
('a-capable-maid', 'A Capable Maid', '능력 있는 시녀님', 'Pelayan yang tidak berguna, Marie, tidak pernah bisa melakukan sesuatu dengan benar. Tetapi, setelah merawat seorang tahanan yang sekarat, ia menjadi orang yang selalu ia inginkan. Ini adalah awal dari pelayan yang cakap, Marie.', 'Sanho', 'user', 1452, 10, 10, 10, 10, 10, 10, 'dang-cap-nhat', 'https://www.komikid.com/uploads/manga/a-capable-maid/cover/cover_250x350.jpg', '2', '2020-07-21 10:36:40', '2020-07-21 10:36:40'),
('again-my-life', 'Again My Life', '어게인 마이 라이프', 'Seorang jaksa yang benar, hidup kembali, menghukum penjahat !!!! Seorang jaksa berdarah panas, kim hi wu, dibunuh dan ditenggelamkan ke laut sambil mengejar tiran yang menguasai Korea. Tapi, Kim Hi Wu, bertemu dengan malaikat maut yang memberinya kesempatan untuk hidup kembali dan mengirimnya kembali ketika dia berusia 18 tahun. Sebagai siswa sekolah menengah, kim hi wu, bersiap untuk menghukum tiran Jo Tae Sup. “Untuk mendapatkan iblis, kamu harus menjadi satu”', '이해날', 'user', 1354, 10, 10, 10, 10, 10, 10, 'dang-cap-nhat', 'https://www.komikid.com/uploads/manga/again-my-life/cover/cover_250x350.jpg', '2', '2020-07-21 10:12:49', '2020-07-21 10:12:49'),
('agravity-boys', 'Agravity Boys', '', 'Tahun 2118 … Empat astronot muda menuju ke bintang-bintang untuk menemukan perbatasan baru umat manusia … atau begitulah yang mereka pikirkan! Dua hari setelah mereka pergi, bumi dihancurkan oleh black hole!', 'Nakamura Atsushi', 'user', 1054, 10, 10, 10, 10, 10, 10, 'dang-cap-nhat', 'https://www.komikid.com/uploads/manga/agravity-boys/cover/cover_250x350.jpg', '2', '2020-07-21 10:12:25', '2020-07-21 10:12:25'),
('akame-ga-kill', 'Akame ga Kill!', 'Akame ga Kiru!', 'Sinopsis:  Tatsumi adalah pejuang yang baru saja dirampok oleh seorang gadis cantik, tapi keberuntungannya pun terlihat, seorang gadis cantik telah membawanya ke rumahnya. Dia tidak tahu bahwa keluarga gadis ini adalah keluarga pembunuh yang telah membunuh kedua temannya, Sayo dan Ieyusa, dan ternyata gadis yang merampoknya adalah orang baik-baik kemudian mengajaknya bergabung dengan kelompok mereka...', 'Takahiro', 'user', 1046454, 10, 10, 10, 10, 10, 10, 'dang-cap-nhat', 'https://www.komikid.com/uploads/manga/akame-ga-kill/cover/cover_250x350.jpg', '2', '2020-07-21 10:14:27', '2020-07-21 10:14:27'),
('ane-doki', 'Ane Doki', 'anedoki', 'Seorang gadis SMA yang misterius, berdada, kuat, indah, dan dewasa ... Apa lagi yang bisa seorang pria meminta? Rupanya, Kouta, berusia 13 tahun, tidak menginginkan hal itu. Setelah memberikan gadis SMA es krim, ia kembali menguntungkan dengan menjanjikan untuk mengurus Kouta sementara ayahnya telah pergi perjalanan bisnis. Namun, Kouta tidak suka ide itu karena gadis, Natsuki, memperlakukan dia seperti anak kecil. Meskipun ketegangan satu arah, Natsuki mengatakan Kouta untuk menjadi dewasa yang tidak lari dari apa yang ingin ia lakukan jika ia ingin menjadi dewasa. Dengan kata-katanya dalam pikiran, Kouta menemukan keberanian untuk menyelamatkan idola sekolah, Kanade, dari tiga punk yang mencoba mengganggunya. Natsuki muncul dalam waktu untuk memukuli tiga bajingan setelah beberapa pukulan telah dilemparkan di Kouta. Kouta melihat bahwa dia bukan orang yang buruk, dan memutuskan untuk menerima dia di dalam rumahnya. Rilis baru dibawa ke anda oleh penulis Ichigo 100%, Hatsukoi Limited, Lilim Kiss, dan Sonezaki Shinju; lucu dan sedikit ecchi cinta komedi antara seorang gadis SMA dan seorang anak sekolah menengah!', 'Kawashita, Mizuki', 'user', 2442973, 10, 10, 10, 10, 9, 20, 'dang-cap-nhat', 'https://www.komikid.com/uploads/manga/ane-doki/cover/cover_250x350.jpg', '2', '2020-07-21 10:37:51', '2020-07-21 10:37:51'),
('assassination-classroom', 'Assassination Classroom', 'Ansatsu Kyoushitsu; AssClass', 'Para siswa kelas 3-E memiliki misi: membunuh guru mereka sebelum lulus. Dia telah menghancurkan bulan, dan telah berjanji untuk menghancurkan Bumi jika ia tidak bisa dibunuh dalam waktu satu tahun. Tapi bagaimana kelas ini orang aneh bisa membunuh rakasa tentakel, mampu mencapai Mach 20 speed, yang mungkin menjadi guru terbaik pun dari mereka pernah punya?', 'MATSUI Yuusei', 'user', 1179759, 10, 10, 10, 10, 10, 10, 'dang-cap-nhat', 'https://www.komikid.com/uploads/manga/assassination-classroom/cover/cover_250x350.jpg', '2', '2020-07-21 10:15:05', '2020-07-21 10:15:05'),
('beauty-pop', 'Beauty Pop', 'Beauty Pop Stage 2, Dream Come True, Teen Drop, Twisted Typhoon, I Want to Be a Prince, Shampoo&#039;s Concern, Hysteric Heart, Daily Life in the Narumi Family', 'Đang cập nhật', 'Arai, Kiyoko', 'user', 62167, 12, 12, 12, 12, 10, 10, 'dang-cap-nhat', 'https://www.komikid.com/uploads/manga/beauty-pop/cover/cover_250x350.jpg', '2', '2020-07-21 10:39:34', '2020-07-21 10:39:34'),
('boruto-naruto-next-generations', 'Boruto: Naruto Next Generations', '', 'Đang cập nhật', 'Ikemoto, Mikio', 'user', 8291851, 13, 13, 13, 13, 10, 10, 'dang-cap-nhat', 'https://www.komikid.com/uploads/manga/boruto-naruto-next-generations/cover/cover_250x350.jpg', '2', '2020-07-21 10:03:34', '2020-07-21 10:03:34'),
('c-sword-and-cornett', '+C: Sword and Cornett', '+C: Schwert und Krone; Plus-si: Sword and Cornett', 'Belca Noctircus adalah anak rakyat biasa dan Raja Noctircus. Dia adalah pangeran ketiga dalam keluarga Noctircus kerajaan dan berada di urutan ketiga tahta. Segera setelah kembali dari luar negeri, saudaranya dan putra mahkota Noctircus, Hector, mengungkapkan amibition untuk menciptakan perdamaian dengan Amonel, ras dianggap monster tapi misterius meninggal dari penyakit kronis. Belca dan saudaranya yang lain yang lebih tua, Orcelito menemukan konspirasi di balik kematian Hector dan Belca hampir dibunuh karena itu. Namun, dia diselamatkan oleh berkeliaran penyair / sarjana bernama Eco. Sementara Orcelito diambil oleh Lagen, yang putranya, seorang bangsawan muda, mengunci dia dan memanipulasi dia untuk melakukan hal-hal dengan penawaran dan permintaan Lagen ini.    ', 'YUGYOJI Tama', 'user', 243084, 10, 10, 10, 10, 10, 10, 'dang-cap-nhat', 'https://www.komikid.com/uploads/manga/c-sword-and-cornett/cover/cover_250x350.jpg', '2', '2020-07-21 10:09:19', '2020-07-21 10:09:19'),
('dragon-ball-super', 'Dragon Ball Super', '', 'Đang cập nhật', 'Toyotarou', 'user', 2472062, 10, 10, 10, 10, 9, 10, 'dang-cap-nhat', 'https://www.komikid.com/uploads/manga/dragon-ball-super/cover/cover_250x350.jpg', '2', '2020-07-21 10:07:10', '2020-07-21 10:07:10'),
('jump-romcom-festival', 'Jump RomCom Festival', '', 'Kumpulan one shot pendek dari Festival RomCom Jump', 'Hanada Tomoya', 'user', 1258, 10, 10, 10, 10, 10, 10, 'dang-cap-nhat', 'https://www.komikid.com/uploads/manga/jump-romcom-festival/cover/cover_250x350.jpg', '2', '2020-07-21 10:06:49', '2020-07-21 10:06:49'),
('lian-fei-wei-bao', 'Lian Fei Wei Bao', '炼废通神', 'Mendaur ulang senjata lama, menghancurkan baju besi, harta sampah ! Tang Fei, pemimpin dari tempat pengumpulan sampah pertama di alam semesta, sangat cantik! Dia adalah yang paling jenius dari keluarga Tang, karena perwalian itu dia kehilangan fondasi selama lima tahun. Tapi cincin yang ditinggalkan Kakeknya membuat semua sampah ! Di tangannya, sampah bisa diperbarui, yang lama bisa mendapatkan kembali vitalitasnya, waktu dan ruang bisa diputar-balik. Tidak ada sampah di dunia ini, yang salah tempat. Ikuti Tang Fei dan lihat bagaimana dia memurnikan sampah menjadi harta!', 'sang nt', 'user', 1395, 10, 10, 10, 10, 10, 10, 'dang-cap-nhat', 'https://www.komikid.com/uploads/manga/lian-fei-wei-bao/cover/cover_250x350.jpg', '2', '2020-07-21 10:06:27', '2020-07-21 10:06:27'),
('meng-shi-zai-shang', 'Meng Shi Zai Shang', 'The Distinguished Cute Master, 萌师在上', 'Dia pindah sebagai bos lawan dalam novel, tapi dia dihabisi oleh pemeran utama pria. Untungnya, dia bereinkarnasi sekali lagi, tetapi kembali ke masa lalu, ketika pemimpin pria masih muda! Melihat pemimpin laki-laki yang sangat lemah, dia bermasalah dengan dilema. Haruskah dia: 1. membunuhnya, atau 2. mengangkatnya dan secara terbuka meminta harta darinya. Namun, karena dia ingin mendapatkan segala macam harta dari pemeran utama pria, dia memilih opsi kedua. Hal-hal tidak selalu berhasil, karena ia secara tidak sengaja mengangkat domba menjadi serigala jahat.', 'Big Tails &amp; Company', 'user', 1529, 10, 10, 10, 10, 10, 10, 'dang-cap-nhat', 'https://www.komikid.com/uploads/manga/meng-shi-zai-shang/cover/cover_250x350.jpg', '2', '2020-07-21 10:06:08', '2020-07-21 10:06:08'),
('momo-the-blood-taker', 'MOMO: The Blood Taker', 'MOMO-the blood taker-', 'Dari Author yang sama yg bikin manga Boku girl… kini ada cerita baru mengenai kejadian pembunuhan yang kejam dan sadis yakni korban selalu dalam keadaan kering tanpa darah. Mikogami Keiji seorang detective yang ingin membalaskan dendam kepada para pembunuh itu atau lebih bisa di kenal Vampire yang sudah membuat kekasihnya mati. Tetapi… di saat bersamaan… Siapakah gadis berambut putih yang selalu memperhatikan dia?', 'SUGITO Akira', 'user', 2665, 12, 12, 12, 12, 10, 10, 'dang-cap-nhat', 'https://www.komikid.com/uploads/manga/momo-the-blood-taker/cover/cover_250x350.jpg', '2', '2020-07-21 10:08:54', '2020-07-21 10:08:54'),
('nanatsu-no-maken-ga-shihai-suru', 'Nanatsu no Maken ga Shihai suru', 'Seven Swords Dominate, 七つの魔剣が支配する, 主宰七魔剑', 'Cerita dimulai pada musim semi tertentu di Kimberly Magic School. Di mana siswa yang bangga, memiliki tujuan, dan berjubah hitam pergi ke sekolah dengan tongkat pedang di ikat pinggang mereka. Ketika mereka pergi ke sekolah, mereka bertemu sederet makhluk magis yang berpawai di bawah pohon sakura. Salah satu siswa, Oliver, berteman dengan para pendatang baru, tetapi matanya tertuju pada seorang gadis yang sendirian. Nanao, gadis “samurai” yang membawa pedang Jepang. Kisah pedang sihir mereka dimulai di sini', 'Esuno Sakae', 'user', 8777, 10, 10, 10, 10, 10, 10, 'dang-cap-nhat', 'https://www.komikid.com/uploads/manga/nanatsu-no-maken-ga-shihai-suru/cover/cover_250x350.jpg', '2', '2020-07-21 10:04:41', '2020-07-21 10:04:41'),
('one-punchman', 'One Punch-Man', 'One Punch Man ; One-Punch Man ;  Onepunchman', 'Dalam hal ini baru aksi - komedi , segala sesuatu tentang seorang pemuda bernama Saitama berteriak &quot; RATA-RATA , &quot; dari ekspresi tak bernyawa , kepala botak , untuk fisik mengesankan nya . Namun , rekan -rata tampan ini tidak memiliki masalah rata-rata ... Dia benar-benar seorang superhero yang mencari lawan tangguh ! Masalahnya adalah , setiap kali ia menemukan kandidat yang menjanjikan ia mengalahkan ingus keluar dari mereka dalam satu pukulan . Dapat Saitama akhirnya menemukan seorang penjahat jahat cukup kuat untuk menantangnya ? Ikuti Saitama melalui aktivitas seksual lucu saat ia mencari orang-orang jahat baru untuk menantang !', 'Yusuke Murata', 'user', 80770, 10, 10, 10, 10, 12, 13, 'dang-cap-nhat', 'https://www.komikid.com/uploads/manga/one-punchman/cover/cover_250x350.jpg', '2', '2020-07-21 09:58:53', '2020-07-21 09:58:53'),
('shingeki-no-kyojin', 'Shingeki no Kyojin', 'Attack on Titan', 'Sinopsis: Beberapa ratus tahun yang lalu, manusia hampir dibasmi oleh raksasa. Raksasa yang biasanya digambarkan tinggi, tampaknya tidak memiliki kecerdasan, memakan manusia, dan terburuk dari semua, tampaknya melakukannya untuk kesenangan dan bukan sebagai sumber makanan. Sebagian kecil manusia bertahan hidup dengan menutup diri di kota dilindungi oleh dinding yang sangat tinggi, bahkan lebih tinggi dari yang terbesar dari raksasa. Melangkah maju ke masa kini dan kota belum melihat raksasa di lebih dari 100 tahun. Remaja laki-laki Eren dan saudara angkatnya Mikasa menjadi saksi dari sesuatu yang sangat mengerikan seperti tembok kota dihancurkan oleh raksasa super yang muncul dari udara tipis. Para raksasa kecil membanjiri kota, dua anak menyaksikan dengan ngeri ibu mereka dimakan hidup-hidup. Eren bersumpah bahwa ia akan membunuh setiap raksasa dan membalas dendam untuk semua umat manusia.', 'ISAYAMA Hajime', 'user', 4378816, 10, 10, 10, 10, 10, 10, 'dang-cap-nhat', 'https://www.komikid.com/uploads/manga/shingeki-no-kyojin/cover/cover_250x350.jpg', '2', '2020-07-21 10:07:55', '2020-07-21 10:07:55');
